import { Navbar } from "react-bootstrap";
import { NavT } from "./NavT";

export const Resume = () => {

  const styles = {
    container: {
      maxWidth: "800px",
      margin: "0 auto",
      padding: "20px",
      backgroundColor: "#fff",
      boxShadow: "0px 0px 10px rgba(0, 0, 0, 0.3)"
    },
    heading: {
      textAlign: "center",
      fontSize: "36px",
      fontWeight: "bold",
      marginBottom: "20px"
    },
    subheading: {
      textAlign: "center",
      fontSize: "24px",
      fontWeight: "bold",
      marginBottom: "20px"
    },
    sectionHeading: {
      fontSize: "24px",
      fontWeight: "bold",
      marginBottom: "10px"
    },
    jobTitle: {
      fontSize: "18px",
      fontWeight: "bold",
      marginBottom: "5px"
    },
    jobDate: {
      fontSize: "14px",
      fontWeight: "normal",
      marginBottom: "10px"
    },
    jobDescription: {
      fontSize: "14px",
      fontWeight: "normal",
      marginBottom: "10px"
    },
    projectTitle: {
      fontSize: "18px",
      fontWeight: "bold",
      marginBottom: "5px"
    },
    projectDescription: {
      fontSize: "14px",
      fontWeight: "normal",
      marginBottom: "10px"
    },
    skillsTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      marginBottom: "10px"
    },
    skillsList: {
      fontSize: "14px",
      fontWeight: "normal",
      marginBottom: "10px"
    },
    languageTitle: {
      fontSize: "24px",
      fontWeight: "bold",
      marginBottom: "10px"
    },
    languageList: {
      fontSize: "14px",
      fontWeight: "normal",
      marginBottom: "10px"
    }
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.heading}>John Doe</h1>
      <h2 style={styles.subheading}>Front-End Developer</h2>
      <hr />
      <h3 style={styles.sectionHeading}>Education</h3>
      <p>
        George Brown College | Toronto, ON<br />
        Advanced Diploma | Expected April 2023<br />
        Major in Computer Science<br />
        Relevant Coursework: Advanced Database Development, Advanced Object-Oriented Programming; Web Application Development; Data Structures and Algorithms; System Analysis, Design and Testing
      </p>
      <h3 style={styles.sectionHeading}>Work Experience</h3>
      <div>
        <h4 style={styles.jobTitle}>Web Developer</h4>
        <p style={styles.jobDate}>ABC Company | 2018 - Present</p>
        <ul>
          <li style={styles.jobDescription}>Learned and applied all design concepts such as OOP, MVC, SOLID used as best practices in the current development stage.</li>
          <li style={styles.jobDescription}>Applied Agile methodologies to organize tasks and manage control flow for 60+ projects.</li>
          <li style={styles.jobDescription}>Developed various systems in isolated focus to backend functioning to compute efficiently CRUD operations in various environments using database.</li>
          <li style={styles.jobDescription}>Developed reusable code using design principles such as OOP, MVC, etc. ,/</li>
          </ul>
    </div>
</div>

)
  }
